Categories 18+ Teens, Affairs &amp; Love Triangles, Couples, Feature, Older Men

Cast Keisha Grey, Josie Jagger, Elektra Rose, Shauna Skye, Steven St. Croix, Evan Stone, Alec Knight, Marcus London

Looking For Love In All The Wrong Places.
Featuring stories of young girls enamored by older men. Elektra Rose is a naughty nymphette who needs a little persuasion from her agent to show up for work. Keisha Grey gets a private lesson with her favorite writer. Shauna Skye may not be familiar with her boyfriend's actor father, but she knows a great kiss when she gets one. Josie Jagger has some issues that only her therapist can get to the bottom of.
